Looking back in the log, it comes from 

```
commit 1937e99134200f1e85c9d32b172c102f2572a115
Author: Magdalen Berns <m.berns@thismagpie.com>
Date:   Wed Jan 21 22:36:05 2015 +0000

    Atwrapper add debugging to signals

    Bug: https://bugzilla.gnome.org/show_bug.cgi?id=743320

diff --git a/jni/src/AtkWrapper.c b/jni/src/AtkWrapper.c
index 29111cd..3cbb922 100644
--- a/jni/src/AtkWrapper.c
+++ b/jni/src/AtkWrapper.c
@@ -263,7 +263,9 @@ focus_notify_handler (gpointer p)
   }

   AtkObject* atk_obj = ATK_OBJECT(jaw_impl);
-  atk_focus_tracker_notify(atk_obj);
+  atk_object_notify_state_change(atk_obj,
+                                 ATK_STATE_SHOWING,
+                                 1);

   free_callback_para(para);

@@ -770,6 +772,7 @@ signal_emit_handler (gpointer p)
   JNIEnv *jniEnv = jaw_util_get_jni_env();
   if (jniEnv == NULL)
   {
+    g_warning("\n *** signal_emit_handler: global_ac == NULL *** \n");
     free_callback_para(para);
     return FALSE;
   }
[...]
```

So it looks like it's just a side-effect of an unrelated change. The documentation for atk_focus_tracker_notify tells to indeed rather use atk_object_notify_state_change, and talks about focus change, not showing change, so it does seem to me that it was just made on mistake and should be fixed into focused

Isn't it true that if there are any states other than the invalid state, then the object is valid?

As an alternative, in the loop over jstate_arr (jawobject.c:446), we can specifically check for `ATK_STATE_COLLAPSED`:

```
#if !ATK_CHECK_VERSION (2,38,0)
    if (is_collapsed_java_state(jniEnv, jstate)) {
        continue;
    }
#endif
```
